import React from "react";

function SignUp(props) {
  return (
    <div className="SignUp">
      <div className="SignUpArea">
        <button className="SignUpLeave">X</button>
        <input className="SignUpUsername" placeholder="Username..."></input>
        <input className="SignUpPassword" placeholder="Password..."></input>
        <div className="SignUpButtons">
          <button
            onClick={() => {
              props.setOpenSignIn(false);
            }}
          >
            Sign Up
          </button>
        </div>
      </div>
    </div>
  );
}

export default SignUp;
